" <!-- TC:TOPIC_PAGE -->",
" <div id=\"topicContent\">",
"  <div id=\"drugTitle\">",
"   Aluminum sulfate calcium acetate: Pediatric drug information",
"  </div>",
"  <div id=\"lexiTitleImg\">",
"   <img height=\"17\" src=\"./../images/lexiComp/Lexicomp_2012_71x17.myextg\" width=\"71\"/>",
"  </div>",
"  <div class=\"clear\">",
"  </div>",
"  <div id=\"drugCopy\">",
"   Copyright 1978-2013 Lexicomp, Inc. All rights reserved.",
"  </div>",
"  <div id=\"topicText\">",
"   (For additional information",
"   <a class=\"drug drug_general\" href=\"UTD.htm?0/7/127?source=see_link\">",
"    see \"Aluminum sulfate calcium acetate: Drug information\"",
"   </a>",
"   and",
"   <a class=\"drug drug_patient\" href=\"UTD.htm?19/45/20180?source=see_link\">",
"    see \"Aluminum sulfate calcium acetate: Patient drug information\"",
"   </a>",
"   )",
"   <br/>",
"   For abbreviations and symbols that may be used in Lexicomp (",
"   <a class=\"graphic graphic_table\" href=\"UTD.htm?23/39/24183\">",
"    show table",
"   </a>",
"   )",
"   <div class=\"list ubnlist drugH1Div drugBrandNames\" id=\"F4588854\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Brand Names: U.S.",
"    </span>",
"    <ul>",
"     <li>",
"      Domeboro&reg;",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"list_set htclist drugH1Div drugBrandNames\" id=\"F1044949\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Therapeutic Category",
"    </span>",
"    <ul>",
"     <li>",
"      <span class=\"list-set-name\">",
"       Topical Skin Product",
"      </span>",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"block dos drugH1Div\" id=\"F1044946\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosing: Usual",
"    </span>",
"    <p>",
"     (For additional information",
"     <a class=\"drug drug_general\" href=\"UTD.htm?0/7/127?source=see_link\">",
"      see \"Aluminum sulfate calcium acetate: Drug information\"",
"     </a>",
"     )",
"    </p>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Children and Adults: Topical: Soak the affected area in the solution 2-4 times/day for 15-30 minutes or apply wet dressing soaked in the solution 2-4 times/day for 30-minute treatment periods; rewet dressing with solution every few minutes to keep it moist",
"    </p>",
"   </div>",
"   <div class=\"block foc drugH1Div\" id=\"F14448641\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosage Forms: U.S.",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Tablet for solution: 1 tablet/pint [1:40 dilution]",
"    </p>",
"   </div>",
"   <div class=\"block adm drugH1Div\" id=\"F1044952\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Administration",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Topical: Keep away from eyes, external use only; one powder packet dissolved in 16 oz of water makes a modified Burow's solution equivalent to a 1:40 dilution, 2 packets: 1:20 dilution, 3 packets: 1:13 dilution. When used as a compress or wet dressing, soak a clean soft cloth in the solution. Apply cloth loosely to affected area for 15-30 minutes.",
"    </p>",
"   </div>",
"   <div class=\"block use drugH1Div\" id=\"F1044951\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Use",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Astringent wet dressing for relief of inflammatory conditions of the skin and to reduce weeping that may occur in dermatitis; relieve minor skin irritations due to poison ivy, poison oak, poison sumac, insect bites, athlete&rsquo;s foot, and rashes caused by soaps, detergents, cosmetics, or jewelry",
"    </p>",
"   </div>",
"   <div class=\"block arm drugH1Div\" id=\"F14198742\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Adverse Reactions",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Local: Irritation",
"    </p>",
"   </div>",
"   <div class=\"block coi drugH1Div\" id=\"F1044954\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Contraindications",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Use with topical collagenase",
"    </p>",
"   </div>",
"   <div class=\"block pre drugH1Div\" id=\"F1044945\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Precautions",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Do not use plastic or other impervious material to prevent evaporation",
"    </p>",
"   </div>",
"   <div class=\"block cyt drugH1Div\" id=\"F13298718\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Metabolism/Transport Effects",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     None known.",
"    </p>",
"   </div>",
"   <div class=\"block dri drugH1Div\" id=\"F238199\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Drug Interactions",
"    </span>",
"    <br/>",
"    <br/>",
"    <div class=\"lexi\" id=\"lexiInteractAddInfo\">",
"     (For additional information:",
"     <a class=\"dip\" href=\"./drug-interaction\" target=\"_blank\">",
"      Launch Lexi-Interact&trade; Drug Interactions Program",
"     </a>",
"     )",
"    </div>",
"    <div class=\"lexi\" id=\"lexiInteractImgB\">",
"     <img border=\"0\" height=\"17\" src=\"./../images/lexiComp/Lexicomp_2012_71x17.myextg\" width=\"71\"/>",
"    </div>",
"    <div class=\"clear\">",
"    </div>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     BCG: Antibiotics may diminish the therapeutic effect of BCG.",
"     <i>",
"      Risk X: Avoid combination",
"     </i>",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Sodium Picosulfate: Antibiotics may diminish the therapeutic effect of Sodium Picosulfate.  Management: Consider using an alternative product for bowel cleansing prior to a colonoscopy in patients who have recently used or are concurrently using an antibiotic.",
"     <i>",
"      Risk D: Consider therapy modification",
"     </i>",
"    </p>",
"   </div>",
"   <div class=\"block prf drugH1Div\" id=\"F238201\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pregnancy Risk Factor",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     C (",
"     <a class=\"graphic graphic_table\" href=\"UTD.htm?16/42/17068\">",
"      show table",
"     </a>",
"     )",
"    </p>",
"   </div>",
"  </div>",
