var title_f2_18_2339="Preretinal hemorrhages";
var content_f2_18_2339=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F54695&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=0\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F54695&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=0\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Preretinal hemorrhages",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 418px; height: 417px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    A preretinal (subhyaloid) hemorrhage develops when blood escapes into the potential space between retina and vitreous. A preretinal hemorrhage typically is larger than other retinal hemorrhages. Because it is anterior to the retina, a preretinal hemorrhage obscures underlying retinal vessels. In an erect patient, red cells settle, creating a horizontal line of demarcation between plasma above and cells below.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Bickley, LS and Szilagyi, P. Bates' Guide to Physical Examination and History Taking, 8th Ed. Philadelphia: Lippincott Williams &amp; Wilkins 2003. Copyright &copy;2003 Lippincott Williams &amp; Wilkins.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
