var title_f2_18_2349="Vulvar abscess antibiotics";
var content_f2_18_2349=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=OBGYN%2F64305&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=10\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=OBGYN%2F64305&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=10\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Antibiotic therapy for vulvar abscess",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Medication",
"       </td>",
"       <td class=\"subtitle1\">",
"        Dose (adult)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Outpatient oral antibiotic therapy options for vulvar abscess*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Trimethoprim-sulfamethoxazole (TMP-SMX, co-trimoxazole)",
"       </td>",
"       <td>",
"        1 to 2 double strength",
"        <sup>",
"         &bull;",
"        </sup>",
"        tablets twice daily",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Doxycycline",
"        <sup>",
"         &Delta;",
"        </sup>",
"       </td>",
"       <td>",
"        100 mg twice daily",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Clindamycin",
"        <sup>",
"         &Delta;",
"        </sup>",
"        <sup>",
"         &loz;",
"        </sup>",
"       </td>",
"       <td>",
"        <p>",
"         600 mg three times daily or 300 to 450 mg three times daily for mild uncomplicated",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Linezolid",
"       </td>",
"       <td>",
"        600 mg twice daily",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Inpatient intravenous antibiotic therapy options for severe vulvar abscess/infection",
"        <sup>",
"         &sect;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Vancomycin",
"       </td>",
"       <td>",
"        15 to 20 mg/kg/dose every 8 to 12 hours (maximum 2 grams per dose)",
"        <sup>",
"         &yen;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Linezolid",
"       </td>",
"       <td>",
"        600 mg twice daily",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Daptomycin",
"       </td>",
"       <td>",
"        4 mg/kg once daily",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Telavancin",
"       </td>",
"       <td>",
"        10 mg/kg once daily",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Clindamycin",
"        <sup>",
"         &loz;",
"        </sup>",
"       </td>",
"       <td>",
"        600 mg three times daily",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <p>",
"     NOTE: &nbsp;Antimicrobial for management of Bartholin&rsquo;s gland abscess is covered separately.&nbsp; See &ldquo;Disorders of Bartholin&rsquo;s gland&rdquo; section &ldquo;management&rdquo;.",
"    </p>",
"    <div class=\"footnotes\">",
"     * Outpatient antibiotic therapy for vulvar abscess is recommended for 5 to 10 days.",
"     <br>",
"      <sup>",
"       &bull;&nbsp;",
"      </sup>",
"      One double-strength tablet is 160 mg trimethoprim and 800 mg sulfamethoxazole.",
"      <br>",
"       <sup>",
"        &Delta;",
"       </sup>",
"       For empiric coverage combined with later generation oral cephalosporin (eg, cefuroxime axetil or cefprozil) or oral fluoroquinolone. (See text).",
"       <br>",
"        <sup>",
"         &loz;",
"        </sup>",
"        Oral clindamycin is a reasonable choice for empiric&nbsp;coverage if local resistance is low.&nbsp;Data on parenteral use for MRSA are limited.&nbsp; See \"Treatment of skin and soft tissue infections due to methicillin-resistant Staphylococcus aureus in adults\", section \"clindamycin\".",
"        <br>",
"         <sup>",
"          &sect;",
"         </sup>",
"         Due to the likelihood of methicillin-resistant",
"         <em>",
"          Staphylococcus aureus",
"         </em>",
"         (MRSA) infection in vulvar abscesses, these medications should be used in addition to broad-spectrum parenteral antibiotics for 7 to 14 days depending on response.",
"         <br>",
"          <sup>",
"           &yen;",
"          </sup>",
"          For patients with renal insufficiency, serious infection or who are obese, adjust dosage for serum trough concentration of 15-20 mcg/mL. See \"Vancomycin dosing and serum concentration monitoring in adults\".",
"         </br>",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Liu C, Bayer A, Cosgrove SE, et al. Clinical practice guidelines by the Infectious Diseases Society of America for the treatment of methicillin-resistant Staphylococcus aureus infections in adults and children. Clin Infect Dis 2011; 52:e18.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
