"   <a href=\"?imageKey=ALLRG%2F56049&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ALLRG%2F56049&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Example of epinephrine infusion - pediatric 10 kg",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\" colspan=\"6\">",
"        Example of preparation of epinephrine infusion for refractory symptoms of anaphylaxis for pediatric patient of 10 kg body weight for emergency/critical care units",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2\" colspan=\"6\">",
"        <p>",
"         Epinephrine 10 micrograms/mL (0.01 mg/mL)",
"        </p>",
"        <p>",
"         Add 1 mg (1000 micrograms) of epinephrine to 100 mL of 5 percent dextrose water (D5W).",
"         <br/>",
"         Resulting concentration is 10 micrograms per milliliter (mL).",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"6\">",
"        Preparation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"6\">",
"        1.",
"        <strong>",
"         CHECK",
"        </strong>",
"        vial strength.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"6\">",
"        2. To prepare epinephrine infusion for a final concentration of",
"        <strong>",
"         10",
"        </strong>",
"        micrograms per mL, dilute",
"        <strong>",
"         10 mL",
"        </strong>",
"        of",
"        <strong>",
"         0.1 mg/mL",
"        </strong>",
"        epinephrine (also labeled 1:10,000) in 100mL of D5W",
"        <strong>",
"         OR",
"        </strong>",
"        1 mL of 1 mg/mL epinephrine (also labeled 1:1000) in 100 mL of D5W.*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"6\">",
"        Administration",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"6\">",
"        Infuse an initial dose of 0.1 micrograms per kg per minute using a programmable infusion pump and titrate as needed while continuously monitoring the patient's cardiac rhythm and blood pressure.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2\" colspan=\"3\">",
"        Pediatric dose for 10 kg child",
"       </td>",
"       <td class=\"subtitle2\" colspan=\"3\">",
"        <p>",
"         Administration rate",
"        </p>",
"        <p>",
"         1 milligram epinephrine diluted in 100 mL D5W",
"        </p>",
"        <p>",
"         10 micrograms per milliliter",
"        </p>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td class=\"subtitle3\">",
"        Micrograms per kg per minute",
"       </td>",
"       <td class=\"subtitle3\" rowspan=\"12\">",
"        Multiply by patient weight (10 kg)",
"       </td>",
"       <td class=\"subtitle3\">",
"        Micrograms per minute",
"       </td>",
"       <td class=\"subtitle3\">",
"        mL per",
"        <em>",
"         minute",
"        </em>",
"        for 10 kg child",
"       </td>",
"       <td class=\"subtitle3\" rowspan=\"12\">",
"        Multiply by 60 minutes",
"       </td>",
"       <td class=\"subtitle3\">",
"        mL per",
"        <em>",
"         hour",
"        </em>",
"        for 10 kg child",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"centered\">",
"        0.05",
"       </td>",
"       <td class=\"centered\">",
"        0.5",
"       </td>",
"       <td class=\"centered\">",
"        0.05",
"       </td>",
"       <td class=\"centered\">",
"        3",
"       </td>",
"      </tr>",
"      <tr>",
