"        0.2",
"       </td>",
"       <td class=\"centered\">",
"        2",
"       </td>",
"       <td class=\"centered\">",
"        0.2",
"       </td>",
"       <td class=\"centered\">",
"        12",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"centered\">",
"        <span style=\"color: #0000ff;\">",
"         0.3",
"        </span>",
"       </td>",
"       <td class=\"centered\">",
"        <span style=\"color: #0000ff;\">",
"         3",
"        </span>",
"       </td>",
"       <td class=\"centered\">",
"        <span style=\"color: #0000ff;\">",
"         0.3",
"        </span>",
"       </td>",
"       <td class=\"centered\">",
"        <span style=\"color: #0000ff;\">",
