"        36",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"centered\">",
"        <span style=\"color: #0000ff;\">",
"         0.7",
"        </span>",
"       </td>",
"       <td class=\"centered\">",
"        <span style=\"color: #0000ff;\">",
"         7",
"        </span>",
"       </td>",
